INSERT INTO `chat_log` VALUES (1,'2014-11-13 17:32:36',2001,'Sparkles','Rikka','you get whispers yes?'),(2,'2014-11-13 17:32:44',2001,'Rikka','Sparkles','yup'),(3,'2014-11-13 17:34:08',2001,'Sparkles','Rikka','are you getting any significant lag spikes?'),(4,'2014-11-13 17:34:16',2001,'Rikka','Sparkles','nope'),(5,'2014-11-13 17:34:30',2001,'Rikka','Sparkles','300ping avg'),(6,'2014-11-13 17:34:41',2001,'Sparkles','Rikka','server is in canada, not too bad'),(7,'2014-11-13 17:34:56',2001,'Rikka','Sparkles','in in usa so ya ntb'),(8,'2014-11-13 17:35:20',2001,'Sparkles','Rikka','ooh interesting'),(9,'2014-11-13 17:37:04',2001,'Sparkles','Rikka','yah that\'s the timeout for turning you into a ghost triggering'),(10,'2014-11-13 17:37:06',2001,'Sparkles','Rikka','will fix '),(11,'2014-11-13 17:37:07',2001,'Rikka','Sparkles','hard to report and not die lol'),(12,'2014-11-13 17:37:22',2001,'Sparkles','Rikka','what lvl ar eoyu now?'),(13,'2014-11-13 17:37:27',2001,'Rikka','Sparkles','40'),(14,'2014-11-13 17:37:31',2001,'Sparkles','Rikka','meh, not bad'),(15,'2014-11-13 17:38:16',2001,'Rikka','Sparkles','pro4never i presume?'),(16,'2014-11-13 17:38:19',2001,'Sparkles','Rikka','ya'),(17,'2014-11-13 17:43:50',2001,'Sparkles','Rikka','i just reported that cause I tried :P'),(18,'2014-11-13 17:44:10',2001,'Sparkles','Rikka','any other things you noticed i should look at?'),(19,'2014-11-13 17:44:21',2001,'Rikka','Sparkles','thinking'),(20,'2014-11-13 17:45:04',2001,'Rikka','Sparkles','there a lvl req to donate or something?'),(21,'2014-11-13 17:45:14',2001,'Sparkles','Rikka','for nobility?'),(22,'2014-11-13 17:45:21',2001,'Rikka','Sparkles','ya'),(23,'2014-11-13 17:45:25',2001,'Sparkles','Rikka','pretty sur elvl 70'),(24,'2014-11-13 17:45:39',2001,'Rikka','Sparkles','lvl 51 atm'),(25,'2014-11-13 17:45:53',2001,'Sparkles','Rikka','you have full gm permission btw'),(26,'2014-11-13 17:46:09',2001,'Rikka','Sparkles','ya just figured i would test from noob up'),(27,'2014-11-13 17:46:1